import requests

url = "https://world-geo-data.p.rapidapi.com/countries/{code}/cities"
querystring = {"per_page": per_page, "max_population": max_population, "page": page, "min_population": min_population}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "world-geo-data.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

